INSERT INTO `lang_definitions` VALUES (16788, 1572, 15, 'Εάν έχετε επιλέξει να φορτώσετε ηλεκτρονικά εμβάσματα, τότε το παράθυρο αναζήτησης ίδιο αναπαραουσιάζεται με τα τιμολόγια που ταιριάζουν από το αρχείο X12. Μπορείτε να κάνετε κλικ σε οποιοδήποτε από αυτούς τους αριθμούς τιμολογίου (όπως περιγράφεται παρακάτω), εάν θέλετε να κάνετε διορθώσεις πριν να εφαμροστούν οι πληροφορίες εμβάσματος. Για να εφαρμόσετε τις αλλαγές, κάντε κλικ στο κουμπί του αρχείου Διαδικασίας ERA στο κάτω μέρος της σελίδας. Αυτό θα παραγάγει ένα νέο παράθυρο με μια λεπτομερή αναφορά.');
INSERT INTO `lang_definitions` VALUES (16789, 1573, 15, 'Εάν έχετε εισάγει μια Ημερομηνία Πληρωμής στη σελίδα αναζήτησης, αυτή θα αντικαταστήσει την ημερομηνία αποστολής των πληρωμών και των προσαρμογών που λαμβάνονται ούτως ή άλλως από το αρχείο X12. Αυτό μπορεί να είναι χρήσιμο για σκοπούς αναφοράς, αν θέλετε οι αποδείξεις αναφοράς σας να χρησιμοποιήσουν την ημερομηνία αποστολής σας αντί της ημερομηνίας επεξεργασίας της ασφαλιστικής εταιρείας. Σημειώστε ότι αυτό θα επηρεάσει επίσης τις ημερομηνίες των προηγούμενων πληρωμών και τις προσαρμογές που έχουν τεθεί σε δευτερεύουσες απαιτήσεις.');
INSERT INTO `lang_definitions` VALUES (16790, 1574, 15, 'Αν θέλετε να αλλάξετε τους τύπους δεδομένων, ή να προσθέσετε γραμμές ή στήλες ');
